def count_acg(dna):
    """Returns the fraction of nucleotides in the given DNA sequence that are
    not T. Uses a for loop that iterates over the characters in the string."""

    dna = dna.lower()
    count = 0
    for character in dna:
        if character != 't':
            count += 1
    return count / len(dna)

dna = ''

print(count_acg(dna))
print(count_acg('acgagc'))
print(count_acg('tacgagcagc'))
